Subject to the terms and conditions of this Agreement, WGT grants to Distributor a nontransferable license to do the following in the Territory during the Term:
(a) market and distribute the Product to resellers;
(b) demonstrate the Product to potential resellers;
(c) use the Product internally for the sole purpose of providing this product support specified in paragraph 4.1(c);
(d) use and display the Trademarks in connection with marketing and distributing the Product in the Territory pursuant to paragraphs (a) and (b) above.

MSL shall make no use of the tangible MS Software Image and related documentation except as expressly described in this Attachment 6;
 (k) not distribute MS Software Images or any part of the related documentation in encrypted form, unless provided by IBM in such form and expressly directed by IBM to distribute in such form;
 (l) where MSL distributes Preinstalled MS Software within the Products, place a notice over either the Product power switch in the "OFF" position or the power inlet connector which informs the End User that turning on the Product system indicates acceptance of the terms of the End User License Agreement ("EULA"), or comply with such other procedure authorized by IBM to ensure EULA acceptance;
IBM Confidential June 2, 1999 ATT6.1wp Page 16 of 19
 ATTACHMENT 6 SOFTWARE INSTALLATION TERM AND CONDITIONS
 EXHIBIT 5 OF APPENDIX A ADDITIONAL MS PROVISIONS: MS LICENSE OBLIGATIONS IMPOSED ON MSL
 (m) if IBM expressly authorizes MSL in writing to enter End User information on behalf of End Users in the boxes provided for the on-screen End User registration process for the MS Software Image, not to enter Supplier's own name or make any other false or fictional registrations.

The following process shall comply with the requirements set forth in subsection 2(c)(ii) of Appendix A, Attachment 6:
(a) download tools (which are "off the shelf products") used to perform the installation process are not required to be in a secured area;
(b) the recovery CDs are retained in a secured area when not in use;
(c) the installation process is periodically monitored by an IBM employee or IBM contractor employee (who is not an employee of MSL);
(d) the hardfile on which the image is installed is electronically verified and associated to the Product serial number;
(e) MSL electronically tracks the Product serial number, hardfile serial number, and designated model number;
(f) access to the secured area where the recovery CDs are retained when not in use is limited to an IBM employee, IBM contractor employee or MSL;
(g) the MS Certificate of Authenticity (COA) serial number is electronically associated to the Product serial number by the MSL.

Customer has filed / intends to file for approval with the United States Food and Drug Administration and/or its foreign equivalents, an Investigational New Drug Application ("IND") and a New Drug Application ("NDA"), and/or the foreign equivalents thereof, for certain formulations containing the Product;
C. Supplier is engaged in the business of performing contracted process development, Manufacturing and supply services of active pharmaceutical ingredients ("APIs") and intermediates; and
D. Customer desires that Supplier Manufacture the Product in bulk quantities, and Supplier desires to perform such services, each on the terms and conditions set out in this Agreement.

Either party may cancel this Agreement upon the occurrence of any of the following:
Material breach of any covenant, term, condition or other provisions of this Agreement, which breach is not remedied within ten (10) days after notice of such breach is received by the breaching party;
Bankruptcy, reorganization, arrangement or insolvency proceedings being instituted by or against a party;
An assignment by a party for the benefit of its creditors;
Consenting to the appointment of a trustee or receiver by a party, or a trustee or receiver being appointed for a party or for a substantial part of its assets.

§ 335a or (ii) any person who has been convicted of a crime as defined under the FD&C Act, in each case in any capacity associated with or related to the Manufacture or supply of Products or any service rendered to Customer under this Agreement or the Quality Agreement;
j) all Product supplied by Supplier under this Agreement shall be delivered by it free and clear of any security interests, liens, claims, pledges or encumbrances of any kind or nature except for such as are created by Customer; and
k) all records and reports required to be maintained by Supplier under cGMP Requirements shall be accurate and complete in all material respects.
